const Homepage = () => {
 return (
 <div className="Homepage">
 <div className="sidebar">
 <ul>
 <li>
 <FontAwesomeIcon icon={faHouse} />
 Home
 </li>
 <li>
 Menu:
 <select>
 <option value="option1">
 {/*   
